import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

const ContractDetail = () => {
  const { id } = useParams();
  const [contract, setContract] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(false);

  useEffect(() => {
    fetch("/contracts.json")
      .then((res) => res.json())
      .then((data) => {
        const c = data.find((item) => item.id === id);
        if (c) {
          // Mock detail API
          setContract({
            ...c,
            clauses: [
              { title: "Termination", summary: "90 days notice period.", confidence: 0.82 },
              { title: "Liability Cap", summary: "12 months’ fees limit.", confidence: 0.87 },
            ],
            insights: [
              { risk: "High", message: "Liability cap excludes data breach costs." },
              { risk: "Medium", message: "Renewal auto-renews unless cancelled 60 days before expiry." },
            ],
            evidence: [
              { source: "Section 12.2", snippet: "Total liability limited to 12 months’ fees.", relevance: 0.91 },
            ],
          });
        } else {
          setError(true);
        }
        setLoading(false);
      })
      .catch(() => {
        setError(true);
        setLoading(false);
      });
  }, [id]);

  if (loading) return <p className="text-indigo-500 p-6">Loading contract details...</p>;
  if (error || !contract) return <p className="text-red-500 p-6">Contract not found.</p>;

  return (
    <div className="p-6">
      <h2 className="text-3xl font-bold mb-4 text-indigo-600">{contract.name}</h2>
      <p className="mb-2">
        <strong>Parties:</strong> {contract.parties}
      </p>
      <p className="mb-2">
        <strong>Status:</strong> {contract.status} | <strong>Risk:</strong> {contract.risk}
      </p>
      <p className="mb-6">
        <strong>Start:</strong> {contract.start || "N/A"} | <strong>Expiry:</strong> {contract.expiry}
      </p>

      {/* Clauses */}
      <div className="mb-6">
        <h3 className="text-2xl font-semibold mb-2 text-indigo-500">Clauses</h3>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          {contract.clauses.map((cl, idx) => (
            <div key={idx} className="p-4 border rounded shadow-sm hover:shadow-md transition bg-white">
              <h4 className="font-semibold">{cl.title}</h4>
              <p>{cl.summary}</p>
              <p className="text-sm text-gray-500">Confidence: {(cl.confidence * 100).toFixed(0)}%</p>
            </div>
          ))}
        </div>
      </div>

      {/* AI Insights */}
      <div className="mb-6">
        <h3 className="text-2xl font-semibold mb-2 text-indigo-500">AI Insights</h3>
        <ul className="space-y-2">
          {contract.insights.map((ins, idx) => (
            <li key={idx} className="p-3 border rounded flex justify-between items-center bg-gray-50">
              <span>{ins.message}</span>
              <span
                className={`px-2 py-1 rounded text-white ${
                  ins.risk === "High" ? "bg-red-600" : ins.risk === "Medium" ? "bg-yellow-500" : "bg-green-600"
                }`}
              >
                {ins.risk}
              </span>
            </li>
          ))}
        </ul>
      </div>

      {/* Evidence Panel */}
      <div>
        <h3 className="text-2xl font-semibold mb-2 text-indigo-500">Evidence</h3>
        <div className="space-y-2">
          {contract.evidence.map((ev, idx) => (
            <div key={idx} className="p-3 border rounded bg-gray-50 flex justify-between items-center">
              <div>
                <p className="font-medium">{ev.source}</p>
                <p>{ev.snippet}</p>
              </div>
              <span className="text-sm text-gray-600">{(ev.relevance * 100).toFixed(0)}%</span>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default ContractDetail;
